import React from 'react';
import CrystalGameImage from '../images/Crystal_Game.png';
import { Image, Grid, Container } from 'semantic-ui-react'

function CrystalGame() {
    return(
    <Container  >
    <Image src={CrystalGameImage} size="massive" centered/><br />
    <b>Description: </b>Can you figure out what each crystal is worth without going over?<br />
    <b>Languages: </b>HTML, CSS, Javascript
    </Container>
    )
}

export default CrystalGame;
